import React, { Component, Fragment, useEffect, useState } from "react";
import styled from "styled-components";
import { SURVEY_DATA } from "../../config";
import { flexCenter } from "../../styles/CommonStyle";

const Survey = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch(SURVEY_DATA)
      .then((res) => res.json())
      .then((res) => setData(res.survey));
  }, []);

  console.log(data);
  return (
    <Fragment>
      <WrapSurvey>
        <Header>
          <span>핵심 능력 테스트</span>
          <span>/{data.length}</span>
        </Header>
        <WrapMain>
          <Question>
            <h1>자유시간이 있을때 나는</h1>
          </Question>
          <Answer>
            <div className="firstAnswer"></div>
            <p>vs</p>
            <div className="secondAnswer"></div>
          </Answer>
        </WrapMain>
      </WrapSurvey>
    </Fragment>
  );
};

export default Survey;

const WrapSurvey = styled.section`
  ${flexCenter};
  flex-direction: column;
`;

const Header = styled.section`
  display: flex;
  justify-content: space-between;
  width: 360px;
  padding: 170px 24px 0 24px;
  color: rgba(0, 0, 0, 0.4);
  font-size: 15px;
`;

const WrapMain = styled.section``;

const Question = styled.div``;

const Answer = styled.div``;
